import { Routes, Route } from 'react-router';
import '../App.css';

function Layout() {
	return (
		<div className='sign-page'>
			<div className='picture'></div>
			<div className='content-wrapper'></div>
		</div>
	);
}

function App() {
	return (
		<Routes>
			<Route path='/home'></Route>
		</Routes>
	);
}

export default App;
